export class DataGrid {
  constructor(i, x, y, w, h) {
    this.i = i;
    this.x = x;
    this.y = y;
    this.w = w;
    this.h = h;
  }
}

export class DataGridWithText extends DataGrid {
  constructor(i, x, y, w, h) {
    this.i = i;
    this.x = x;
    this.y = y;
    this.w = w;
    this.h = h;
  }
}
